(4715, 1, 'es', 'labels', 'backend.lessons.video_guide', '<p class = \"mb-1\"> <b> Youtube: </b> Vaya a Youtube -> Vaya al video que desea visualizar -> haga clic en el botn Compartir debajo del video. Copia los enlaces y pgalos en el cuadro de texto anterior </p>\n<p class = \"mb-1\"> <b> Vimeo: </b> Vaya a Vimeo -> Vaya al video que desea mostrar -> haga clic en el botn Compartir y copie la URL del video aqu </p>\n<p class = \"mb-1\"> <b> Subir: </b> Subir <b> mp4 </b> en la entrada del archivo </p>\n<p class = \"mb-1\"> <b> Incrustar: </b> Copiar / Pegar cdigo de insercin en el cuadro de texto anterior </p>', '2020-12-14 05:28:49', '2020-12-14 05:28:49'),
