(4719, 1, 'es', 'labels', 'backend.lessons.vimeo_note', '<b> Instrucciones para agregar el enlace del video: </b> <br> Vaya a vimeo -> abrir video -> haga clic derecho en el video y <b> Copiar URL del video </b> y pguelo aqu. <br> Si desea para agregar varios videos, luego seprelos con <b>, </b> (coma) Firmar.', '2020-12-14 05:28:49', '2020-12-14 05:28:49'),
