(6790, 1, 'fr', 'labels', 'backend.lessons.video_guide', '<p class = \"mb-1\"> <b> Youtube: </b> Allez sur Youtube -> Allez  la vido que vous souhaitez afficher -> cliquez sur le bouton Partager en dessous de la vido. Copiez ces liens et collez-les dans la zone de texte ci-dessus </p>\n<p class = \"mb-1\"> <b> Vimeo: </b> Aller  Vimeo -> Aller  la vido que vous souhaitez afficher -> cliquez sur le bouton Partager et copiez l\'URL de la vido de collage ici </p>\n<p class = \"mb-1\"> <b> Transfrer: </b> Transfrer un fichier <b> mp4 </b> dans l\'entre de fichier </p>.\n<p class = \"mb-1\"> <b> Incorporer: </b> copier / coller le code intgr dans la zone de texte ci-dessus </p>', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
