(6794, 1, 'fr', 'labels', 'backend.lessons.vimeo_note', '<b> Instructions pour ajouter un lien vido: </b> <br> Allez  vimeo -> ouvrir la vido -> cliquez avec le bouton droit sur la vido et <b> Copier l\'URL de la vido </b> et collez-le ici. <br> Si vous le souhaitez pour ajouter plusieurs vidos, sparez-les par <b>, </b> (Virgule).', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
(6795, 1, 'fr', 'labels', 'backend.lessons.yt_note', '<b> Instructions pour ajouter un lien vido: </b> <br> Allez sur youtube -> ouvrir la vido -> faites un clic droit sur la vido et <b> Copier l\'URL de la vido </b> et collez-le ici. <br> Si vous voulez pour ajouter plusieurs vidos, sparez-les par <b>, </b> (Virgule).', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
