(6865, 1, 'fr', 'labels', 'backend.general_settings.counter_note', '<b> Static </b> = Ajouter manuellement des donnes pour le compteur. Veuillez saisir le texte exact que vous souhaitez afficher dans la section des guichets frontaux, <br> <b> Database / Real </b> = Il utilisera des donnes relles de la base de donnes pour tous les champs (Nombre total d\'tudiants inscrits, Nombre total de cours, Nombre total d\'enseignants)', '2020-12-14 05:29:09', '2020-12-14 05:29:09'),
