(7218, 1, 'fr', 'labels', 'backend.update.note_before_upload', '<p> <b> Veuillez effectuer une sauvegarde avant la mise  jour. </b> Un fichier zip mis  jour peut tre fourni avec de nouveaux dossiers et mises  jour de fichiers. <b> Vos fichiers actuels seront remplacs par de nouveaux </b>. Ainsi, <b> si vous avez apport des modifications aux fichiers de l\'application en cours, ce sera PERDU </b>. </p>\n <p> Si vous tlchargez directement depuis la zone de saisie de fichier ci-dessous, vos fichiers seront remplacs. Nous vous recommandons vivement de procder au remplacement manuel des fichiers un par un ou de modifier les modifications en comparant votre fichier modifi actuel et les nouveaux fichiers mis  jour. </p>\n <p> Si vous avez encore de la confusion. S\'il vous plat contactez-nous, nous vous guiderons pour mettre  jour votre application </p>', '2020-12-14 05:29:13', '2020-12-14 05:29:13'),
(7219, 1, 'fr', 'labels', 'backend.update.note_before_upload_title', 'Lire les notes suivantes avant la mise  jour', '2020-12-14 05:29:13', '2020-12-14 05:29:13'),
