(7222, 1, 'fr', 'labels', 'backend.update.warning', '<b> AVERTISSEMENT: nous vous recommandons vivement de mettre  jour le thme par numro de version </b>. <br> <b> Exemple: </b> update_v1.zip, update_v2.zip. S\'il vous plat ne sautez pas le numro de version. Si votre numro de version est 1 et que vous souhaitez le mettre  jour, passez  la version 2. Ne mettez pas  jour directement  la version 3.', '2020-12-14 05:29:13', '2020-12-14 05:29:13'),
